scriptlet.script:
// define simplify mode call HP OO javascriptlet @Daway   
/* #include below in scriptlet to use OOJS@Daway*/ 
/// #include OOScriptLet Common Define used functions V1.0
eval( String(scriptletContext.get("nucl.base.oojs")) );
///
/*
(Nucleus_automation_design_specification_v40: 3.18.5.18 FlexUp Disk in OS)
*/
// Main() 
//=========================================================
try {
//
//Begin : 
//------------------------------------------------------------------------
var osType = serverSize.charAt(2).toUpperCase();
var serverType = serverSize.charAt(0).toUpperCase();
var scriptType = "";
var scriptPath = "";
var scriptArg = "";

if ( "P" == str(serverType) ) 
{
// Begin: physical Machine
   if ( "L" == str(osType) )
   {      /// Begin: physical Machine, Linux
   		scriptArg = diskIndex  + " " + lunId;
    	scriptType = "SH";
    	scriptPath = "LINUX/extend-partition-physical.sh";
   }
   else if ( "W" == str(osType) )
   { /// Begin: physical Machine, Windows
   		scriptArg = "-disk_index " + diskIndex + " -disk_scsiid " + lunId;
    	scriptType = "PS1";
    	scriptPath = "WIN/extend-partition-physical.ps1";  
   }else{
   // other option continue
   }
// End: physical Machine
}
else if ( "V" == str(serverType) )
{
// Begin: Visual Machine
   if ( "L" == str(osType) ) 
   {  /// Begin: Virtual Machine, Linux
   		scriptArg = diskIndex  + " " + lunId;
    	scriptType = "SH";
    	scriptPath = "LINUX/extend-partition.sh";
	}
	else if ( "W" == str(osType) ) 
	{ /// Begin: virtual Machine, Windows
   		scriptArg = "-disk_index " + diskIndex + " -disk_scsiid " + lunId;
    	scriptType = "PS1";
    	scriptPath = "WIN/extend-partition.ps1";    
	}else{/* other option continue */  }
// End: Visual Machine
}else{/* error no option */ }
// do action & display
showInfo();
setVars("000");
//
//------------------------------------------------------------------------
//End: 
// finalize oo javascirpt flow
} catch(e if e instanceof SyntaxError){
    showSyntaxError();
    did(false);
} catch (e){
    var errorMsg = str(e);
    showErrorInfo(errorMsg);
    did(false);
}finally { 
    println();
}  
//Define functions 
//=========================================================
//in Main catch
function showSyntaxError(){
    printline("*",80);
    println("It have error in your operation!!!");
    println("SyntaxError in the javascriptlet content is:");
    // put context variable errorCode
    put("errorCode","999");
    put("errorComponent","SyntaxError in the javascriptlet content");
}
//in Main catch
function showErrorInfo(me){
    printline("*",80);
    println("It have error in your operation!!!");
    println("1) The error message was below:");
    printline("-",80);
    println(me);
    printline("=",80);
    // put context variable errorCode
    put("errorCode","999");
    put("errorComponent",me);
}
//in Main emptyInfo
function showEmptyInfo(){
    printline("*",80);
    println("It was not used Scriptlet on input inspector");
    println("javascriptlet content is empty!");
    printline("=",80);
}
// custom define functiions
//=========================================================
function showInfo(){
//Begin:
	printline("-",80);
	println("osType: "+ osType);
	println("serverType: " + str(serverType));
	println("scriptType: " + str(scriptType));
	println("scriptPath: " + str(scriptPath));
	println("scriptArgs: " + str(scriptArg));
	printline("-",80);
//End:
}
function setVars(errorCode){
//Begin:
    put("scriptType",str(scriptType));
	put("scriptPath",str(scriptPath));
	put("scriptArgs",str(scriptArg));
	put("errorCode",errorCode);
	put("errorComponent","scriptType:"+str(scriptType)+",scriptPath:"+str(scriptPath));
//End: 
}
// end of define functions
//=========================================================
